import React, { Component } from 'react'
import Box from '../components/Box'

export default class Login extends Component {
    render() {
        return (
            <div className="login">
                <Box extraClass="login-box">
                    <h1 style={{fontFamily: 'Inter, Oxygen, sans-serif'}}>IUBConnect</h1>
                </Box>
            </div>
        )
    }
}
